<h3 class="long_text svelte-17kd3fp">It was quite easy to calculate GPA till grade ten as credit hour of both practical and theory used to be same. But in grade 12 it may vary according to subjects. For eg. credit hour of Nepali(Theory) is 2.25 but Nepali(Practical) is 0.75 and for English(Therory) credit hour is 3 but for English(Practical) is 1. In order to get A+ in Nepali(Theory) you need to get 90% of 75 which is 67.5 and for Nepali(Practical) 90% of 25 = 22.5 is required.</h3> 
